import tkinter as tk
from tkinter import filedialog, Canvas
from PIL import Image, ImageDraw, ImageTk
import math
import base64
from io import BytesIO

class CircleCropApp:
    def __init__(self, root):
        self.root = root
        self.root.title("Circle Crop Tool")

        # Set the window icon using a base64-encoded string
        self.set_icon()

        # Create a frame to hold the buttons
        self.button_frame = tk.Frame(root)
        self.button_frame.pack(side=tk.TOP, fill=tk.X)

        self.load_button = tk.Button(self.button_frame, text="Load Image", command=self.load_image)
        self.load_button.pack(side=tk.LEFT)

        self.save_button = tk.Button(self.button_frame, text="Save Image", command=self.save_image)
        self.save_button.pack(side=tk.LEFT)

        self.canvas = Canvas(root, width=800, height=600)
        self.canvas.pack(fill=tk.BOTH, expand=True)

        self.image = None
        self.image_id = None
        self.circle_id = None
        self.circle_center = (0, 0)
        self.circle_radius = 0
        self.drawing = False
        self.moving = False

        self.canvas.bind("<Button-1>", self.on_click)  # Handle left click
        self.canvas.bind("<B1-Motion>", self.move_circle)  # Move circle with left click drag
        self.canvas.bind("<ButtonRelease-1>", self.finish_moving)  # Release to stop moving

    def set_icon(self):
        # Base64 encoded PNG icon
        base64_icon = """
        
        """
        # Decode the base64 string
        icon_data = base64.b64decode(base64_icon)
        icon_image = Image.open(BytesIO(icon_data))
        icon_image = icon_image.resize((16, 16), Image.LANCZOS)  # Resize if necessary
        self.icon_photo = ImageTk.PhotoImage(icon_image)
        self.root.iconphoto(False, self.icon_photo)
    

    def load_image(self):
        file_path = filedialog.askopenfilename(filetypes=[("Image files", "*.jpg;*.png")])
        if file_path:
            self.image = Image.open(file_path).convert("RGBA")
            self.display_image()

    def display_image(self):
        self.tk_image = ImageTk.PhotoImage(self.image)
        # Adjust the canvas size to fit the image
        self.canvas.config(width=self.image.width, height=self.image.height)
        if self.image_id:
            self.canvas.delete(self.image_id)
        # Center the image on the canvas
        self.image_id = self.canvas.create_image(self.image.width // 2, self.image.height // 2, anchor=tk.CENTER, image=self.tk_image)

    def on_click(self, event):
        if self.is_within_circle(event.x, event.y):
            # If clicked inside the circle, start moving
            self.moving = True
            self.offset_x = event.x - self.circle_center[0]
            self.offset_y = event.y - self.circle_center[1]
        else:
            # If clicked outside the circle, start drawing a new circle
            self.drawing = True
            self.circle_center = (event.x, event.y)
            self.circle_radius = 0
            self.draw_circle()

    def move_circle(self, event):
        if self.moving:
            self.circle_center = (event.x - self.offset_x, event.y - self.offset_y)
            self.draw_circle()
        elif self.drawing:
            # Update the radius if drawing
            self.circle_radius = int(math.sqrt((event.x - self.circle_center[0]) ** 2 + 
                                                (event.y - self.circle_center[1]) ** 2))
            self.draw_circle()

    def finish_moving(self, event):
        self.moving = False
        self.drawing = False  # Stop drawing if moving

    def draw_circle(self):
        if self.circle_id:
            self.canvas.delete(self.circle_id)

        # Check if the circle radius is greater than zero
        if self.circle_radius > 0:
            x, y = self.circle_center
            self.circle_id = self.canvas.create_oval(
                x - self.circle_radius, y - self.circle_radius,
                x + self.circle_radius, y + self.circle_radius,
                outline='red', width=2
            )

    def is_within_circle(self, x, y):
        cx, cy = self.circle_center
        return (x - cx) ** 2 + (y - cy) ** 2 <= self.circle_radius ** 2

    def save_image(self):
        if self.image:
            # Create a new image with a transparent background
            result = Image.new("RGBA", self.image.size, (0, 0, 0, 0))
            mask = Image.new("L", self.image.size, 0)
            draw = ImageDraw.Draw(mask)
            x, y = self.circle_center
            draw.ellipse((x - self.circle_radius, y - self.circle_radius,
                           x + self.circle_radius, y + self.circle_radius), fill=255)

            # Paste the original image onto the result using the mask
            result.paste(self.image, (0, 0), mask)

            # Crop to the bounding box of the circle
            left = x - self.circle_radius
            upper = y - self.circle_radius
            right = x + self.circle_radius
            lower = y + self.circle_radius
            result = result.crop((left, upper, right, lower))

            save_path = filedialog.asksaveasfilename(defaultextension=".png",
                                                       filetypes=[("PNG files", "*.png")])
            if save_path:
                result.save(save_path)

if __name__ == "__main__":
    root = tk.Tk()
    app = CircleCropApp(root)
    root.mainloop()
